                    <br>
                    <h4>Where is my order?</h4>
                    <br>
                    <p>The easiest way to check the status of your order is to go to the <a");
            BeginWriteAttribute("href", " href=\"", 3291, "\"", 3298, 0);
            EndWriteAttribute();
            WriteLiteral(@">Order Status</a> page. You will be asked to enter your order number there. You can also call our customer service number at (866) 452-7707.</p>
                    <br>
                    <h4>How do I use my promo code?</h4>
                    <br>
                    <p>Enter your code at checkout exactly as it appears in the email, printed offer or webpage. Click ""Apply"" and your discount will be detailed in the payment summary. Only one promotional discount code allowed per order. You can find additional Terms & Conditions detailed on the original offer..</p>
                    <br>
                    <h4>What if my promo code is not working?</h4>
                    <br>
                    <p>If you tried your promo code and it is not showing a discount, please email us at <a");
            BeginWriteAttribute("href", " href=\"", 4103, "\"", 4110, 0);
            EndWriteAttribute();
            WriteLiteral(@">info@dullesglassandmirror.com</a> or call us at (866) 452-7707.</p>
                    <br>
                    <h4>What is your Return Policy?</h4>
                    <br>
                    <p>We are 100% committed to ensuring that you are pleased with your order. Please review our <a");
            BeginWriteAttribute("href", " href=\"", 4406, "\"", 4413, 0);
            EndWriteAttribute();
            WriteLiteral(@">Return Policy</a> here.</p>
                    <br>
                    <h4>Can I ship my order internationally?</h4>
                    <br>
                    <p>At this time, Dulles Glass & Mirror is only able to ship to the contiguous United States (excluding Alaska and Hawaii). We do not ship internationally.</p>
                    <br>
                    <h4>What is your cutting tolerance?</h4>
                    <br>
                    <p>The industry-wide accepted tolerance and our cutting tolerance is +/- 1/8"".</p>
                    <br>
                    <h4>What are your quality standards?</h4>
                    <br>
                    <p>All glass contains various types of flaws or blemishes, which may be visible to the naked eye. This is unavoidable - even the finest raw materials contain minor flaws. The federal government mandates that no defects should be visible in the glass when it is viewed horizontally or vertically from 11 feet away under normal lighting. All of");
